(17, 'OPPO Find X5 Pro phin bn Blue Leather hon ton mi va c ra mt, cng nhau tm hiu xem c g HOT khng no?', 'Hm 25/2, OPPO  cho ra mt mu flagship Find X5 Pro trn th trng ton cu. Mi y, OPPO tip tc tung ra Find X5 Pro phin bn Blue Leather, tip ni ca 2 phin bn Ceramic Black v Ceramic White c cng b trc .', '<div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"OPPO Find X5 Pro Blue Leather Edition\" src=\"https://cdn.tgdd.vn/Files/2022/02/27/1417534/oppo-find-x5-pro-1_1280x720-800-resize.jpg\" data-origin=\"100,100\" data-proportion=\"true\" data-size=\"100%,\" data-align=\"\" data-file-name=\"oppo-find-x5-pro-1_1280x720-800-resize.jpg\" data-file-size=\"0\" name=\"oppo-find-x5-pro-1_1280x720-800-resize.jpg\" style=\"width: 100%;\" data-rotate=\"\" data-rotatex=\"\" data-rotatey=\"\" data-percentage=\"100,\" data-index=\"8\"></figure></div></div><h3>Hm 25/2,<span>&nbsp;</span><a href=\"https://www.thegioididong.com/dtdd-oppo\" target=\"_blank\" type=\"OPPO\">OPPO</a><span>&nbsp;</span> cho ra mt mu flagship<span>&nbsp;</span><a href=\"https://www.thegioididong.com/dtdd/oppo-find-x5-pro\" target=\"_blank\" type=\"Find X5 Pro\">Find X5 Pro</a><span>&nbsp;</span>trn th trng ton cu. Mi y, OPPO tip tc tung ra Find X5 Pro phin bn Blue Leather, tip ni ca 2 phin bn Ceramic Black v Ceramic White c cng b trc .</h3><div class=\"se-component se-image-container __se__float-center\" contenteditable=\"false\"><figure style=\"margin: auto;\"><img src=\"data:image/jpeg;base64,\" alt=\"\" data-rotate=\"\" data-proportion=\"true\" data-rotatex=\"\" data-rotatey=\"\" data-align=\"center\" data-size=\",\" data-percentage=\"auto,auto\" data-index=\"14\" data-file-name=\"oppo-find-x5-series-omww-7777-2994-5141-1645721101_1280x720-800-resize.jpg\" data-file-size=\"58602\" origin-size=\"800,450\" data-origin=\",\" style=\"\"><figcaption><div><span style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Hnh nh OPPO FIND X5 Series (Ngun: OPPO)</span></div></figcaption></figure></div><p>Mt lng thit b s c bao ph mt lp da mu xanh, c tnh thay v ph lp gm nh cc phin bn trc y. Ngoi s khc bit v mt thit k, phn cu hnh ca thit b dng nh khng thay i.</p><p>OPPO Find X5 Pro s hu tm nn LTPO AMOLED cao cp&nbsp;v c kch thc mn hnh 6.7 inch, cung cp  phn gii Quad HD+ sc nt cng nh tn s qut mn hnh ln n 120 Hz.</p><p>Bn cnh , mn hnh ca thit b cng h tr  ph mu DCI-P3 100%, gip ti to mu sc mt cch chnh xc nht. Ngoi ra, mn hnh Find X5 Pro cng s hu  sng ln n&nbsp;1.300 nits, hin th r nt ngay c khi s dng thit b trc tip di nh mt tri.</p><div class=\"se-component se-image-container __se__float-none\" contenteditable=\"false\"><figure style=\"margin: 0px;\"><img src=\"data:image/jpeg;base64,\" alt=\"\" data-rotate=\"\" data-proportion=\"true\" data-rotatex=\"\" data-rotatey=\"\" data-size=\",\" data-align=\"none\" data-percentage=\"auto,auto\" data-index=\"12\" data-file-name=\"find-x5-a-2784-1645721030-3619-1645721101_1280x720-800-resize.jpeg\" data-file-size=\"67341\" origin-size=\"800,450\" data-origin=\",\" style=\"\"><figcaption><span style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">H thng camera tn tin trn OPPO Find X5 Series (Ngun: OPPO)</span><br></figcaption></figure></div><div class=\"captionnews\"><br></div><p>im nhn ca thit b nm  cm camera sau c trang b ba ng knh thay v bn nh th h trc v OPPO  loi b i ng knh hin vi.</p><p>Trong , c hai camera chnh v camera gc siu rng u s dng cm bin IMX 766  phn gii 50 MP ca Sony, cn ng knh tele th c  phn gii 13 MP h tr zoom&nbsp; Hybird 5x v zoom k thut s 20x.</p><p>im ni bt th hai l chip MariSilicon X gip tng cng cc tc v x l hnh nh c h tr bi AI, gip Find X5 v X5 Pro c th quay video 4K vi ch  ban m bng camera chnh v camera gc siu rng. Ngoi ra, camera chnh ca X5 Pro cn c trang b h thng chng rung OIS nm trc.</p><div class=\"se-component se-image-container __se__float-none\" contenteditable=\"false\"><figure style=\"margin: 0px;\"><img src=\"data:image/jpeg;base64,\" alt=\"\" data-rotate=\"\" data-proportion=\"true\" data-rotatex=\"\" data-rotatey=\"\" data-size=\",\" data-align=\"none\" data-percentage=\"auto,auto\" data-index=\"16\" data-file-name=\"oppo-find-x5-pro-09-ifzb-8905-5998-9057-1645721101_1280x720-800-resize.jpeg\" data-file-size=\"25463\" data-origin=\",\" style=\"\"><figcaption><div><span style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">2 phin bn mu sc u tin ca OPPO Find X5 Series (Ngun: OPPO)</span></div></figcaption></figure></div><p>Ging nh phn ln cc flagship gn y, OPPO Find X5 Pro c trang b bi vi x l Snapdragon 8 Gen 1.  m bo hiu sut mt m hn, chic<span>&nbsp;</span><a href=\"https://www.thegioididong.com/dtdd/\" target=\"_blank\" type=\"smartphone\">smartphone</a><span>&nbsp;</span>ny cng c trang b h thng lm mt a tng  gim nhit  in thoi trong thi gian chi game ko di.</p><p>C hai u c nng cp dung lng pin, trong <span>&nbsp;</span><a href=\"https://www.thegioididong.com/dtdd/oppo-find-x5\" target=\"_blank\" type=\"Find X5\">Find X5</a><span>&nbsp;</span>c pin 4.800 mAh cn Find X5 Pro l 5.000 mAh. Sc nhanh SuperVOOC cng c OPPO tng cng sut ln 80 W cho php in thoi sc t 0% n 50% pin ch trong vng 12 pht. Ngoi ra,&nbsp;bn Pro cn h tr sc nhanh khng dy 50 W cn bn tiu chun l 30 W.</p><p>Bn c mong OPPO Find X5 Series v th trng Vit Nam trong thi gian sp ti ch?</p><p><br></p>', 'https://i.ibb.co/nrX08k0/oppo-find-x5-pro-1-1280x720-800-resize-jpg.jpg', 'Trn Hong Khang', 'normal', '2022-02-28 05:28:35');
INSERT INTO `news` (`id`, `title`, `summary`, `content`, `image`, `author`, `type`, `created`) VALUES
(18, 'Chic smartphone thuc thng hiu Realme sp ti y c th s c i tn thnh OnePlus, bn  bit cha?', 'Realme V25 s ra mt ti th trng Trung Quc vo ngy 3/3 sp ti y. Thit k mt sau ca in thoi  c hng tit l vo tun trc v theo cc ngun tin r r th thit b ny s c tn OnePlus khi c ra mt ti th trng quc t.', '<div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"Chic smartphone thuc thng hiu Realme s i tn thnh OnePlus?\" src=\"https://cdn.tgdd.vn/Files/2022/02/27/1417532/16_1280x720-800-resize.jpg\" data-origin=\"100,100\" data-proportion=\"true\" data-size=\"100%,\" data-align=\"none\" data-file-name=\"16_1280x720-800-resize.jpg\" data-file-size=\"0\" data-rotate=\"\" data-percentage=\"100,\" name=\"16_1280x720-800-resize.jpg\" style=\"width: 100%;\" data-index=\"0\" origin-size=\"800,450\"><figcaption><div><span style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Chic smartphone thuc thng hiu Realme s i tn thnh OnePlus? (Ngun: Gizmochina)</span></div></figcaption></figure></div></div><div class=\"captionnews\"><br></div><div class=\"captionnews\"><a href=\"https://www.thegioididong.com/dtdd/realme-v25\" target=\"_blank\" type=\"Realme V25\" style=\"font-size: 1.17em; font-weight: 700; background-color: rgb(255, 255, 255);\" class=\"on\">Realme V25</a><span style=\"font-size: 1.17em; font-weight: 700;\">&nbsp;</span><span style=\"font-size: 1.17em; font-weight: 700;\">s ra mt ti th trng Trung Quc vo ngy 3/3 sp ti y. Thit k mt sau ca</span><span style=\"font-size: 1.17em; font-weight: 700;\">&nbsp;</span><a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\" type=\"in thoi\" style=\"font-size: 1.17em; font-weight: 700; background-color: rgb(255, 255, 255);\">in thoi</a><span style=\"font-size: 1.17em; font-weight: 700;\">&nbsp;</span><span style=\"font-size: 1.17em; font-weight: 700;\"> c hng tit l vo tun trc v theo cc ngun tin r r th thit b ny s c tn OnePlus khi c ra mt ti th trng quc t.</span><br></div><p>Qua s xut hin trn Geekbench, thit b ny s c trang b con chip Snapdragon 695. V cc thng s k thut ca in thoi cng cho thy, thit b ny c th s c i tn thnh OnePlus bn ngoi th trng Trung Quc.</p><p>Trc y,<span>&nbsp;</span><a href=\"https://www.thegioididong.com/dtdd-realme\" target=\"_blank\" type=\"Realme\">Realme</a><span>&nbsp;</span>cha tng ra mt smartphone thuc dng V ca hng bn ngoi Trung Quc. Do , V25 c th s l phin bn c quyn dnh cho th trng t dn ny. V cc thng s k thut ca Realme V25 ging vi<span>&nbsp;</span><a href=\"https://www.thegioididong.com/dtdd/realme-9-pro\" target=\"_blank\" type=\"Realme 9 Pro\">Realme 9 Pro</a><span>&nbsp;</span> ra mt ti n  vo u thng 2 va qua.</p><div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"Chic smartphone thuc thng hiu Realme s i tn thnh OnePlus?\" class=\" lazyloaded\" src=\"https://cdn.tgdd.vn/Files/2022/02/27/1417532/gsmarena_003rm9p_1280x853-800-resize.jpg\" data-origin=\"100,100\" data-proportion=\"true\" data-size=\"100%,\" data-align=\"none\" data-file-name=\"gsmarena_003rm9p_1280x853-800-resize.jpg\" data-file-size=\"0\" data-rotate=\"\" data-percentage=\"100,\" name=\"gsmarena_003rm9p_1280x853-800-resize.jpg\" style=\"width: 100%;\" data-index=\"1\" origin-size=\"800,533\"><figcaption><div><span style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Realme V25 s c thng s k thut ging vi Realme 9 Pro (Ngun: GSMArena)</span></div></figcaption></figure></div></div><div class=\"captionnews\"><br></div><p>Cc thng tin r r gn y  tit l rng V25 s c lp v pha sau i mu ging nh Realme 9 Pro. Tuy nhin, da trn nhng thng tin r r gn y th Realme V25 c th s c i tn thnh OnePlus Nord CE 2 Lite  th trng quc t.</p><p>Tun trc, mt ngun tin  pht hnh s  mt sau ca OnePlus Nord CE 2 Lite sp ra mt. C th thy, thit b c thit k trng ging nh Realme V25 v Realme 9 Pro. Ngoi ra, cc thng s k thut c n i ca Nord CE 2 Lite cng ging vi Realme V25.</p><div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"Chic smartphone thuc thng hiu Realme s i tn thnh OnePlus?\" class=\" lazyloaded\" src=\"https://cdn.tgdd.vn/Files/2022/02/27/1417532/oneplus-nord-ce-2-lite_1280x853-800-resize.jpg\" data-origin=\"100,100\" data-proportion=\"true\" data-size=\"100%,\" data-align=\"none\" data-file-name=\"oneplus-nord-ce-2-lite_1280x853-800-resize.jpg\" data-file-size=\"0\" data-rotate=\"\" data-percentage=\"100,\" name=\"oneplus-nord-ce-2-lite_1280x853-800-resize.jpg\" style=\"width: 100%;\" data-index=\"2\" origin-size=\"800,533\"><figcaption><span style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Hnh nh c cho l s  thit k mt sau ca OnePlus Nord CE 2 Lite (Ngun: Gizmochina)</span><br></figcaption></figure></div></div><div class=\"captionnews\">Cc thng s k thut ca Nord CE 2 Lite  c tit l rng thit b s c trang b mn hnh IPS LCD 6.58 inch tc  lm mi 120 Hz, s dng chip Snapdragon 695, dung lng RAM 6 GB hoc 8 GB v b nh trong 64 GB hoc 128 GB.<br></div><p>Ngoi ra, my s c camera trc 16 MP v cm ba camera vi  phn gii ln lt l 64 MP + 2 MP + 2 MP. V thit b s c pin 5.000 mAh h tr sc nhanh 33 W.</p><p>Hin ti, vn cha c thng tin v ngy ra mt ca Nord CE 2 Lite nhng c nhiu thng tin cho rng thit b s c ra mt vo thng 3 hoc thng 4.</p><p>Bn ngh sao v vic i tn ny ca Realme?</p><p><br></p>', 'https://i.ibb.co/z86qrHj/16-1280x720-800-resize-jpg.jpg', 'Trn Hong Khang', 'normal', '2022-02-28 05:31:28'),
(19, 'Cch hin tt c ng dng trong System Tray ra thanh Taskbar rt n gin, gip bn thao tc nhanh chng hn', 'Cch hin tt c ng dng trong System Tray ra thanh Taskbar rt n gin, gip bn thao tc nhanh chng hn', '<div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"Cch hin th icon trn thanh Taskbar\" src=\"https://cdn.tgdd.vn/Files/2022/01/20/1411870/cach-hien-thi-icon-tren-thanh-taskbar_1280x720-800-resize.jpg\" data-origin=\"100,100\" data-proportion=\"true\" data-size=\"100%,\" data-align=\"\" data-file-name=\"cach-hien-thi-icon-tren-thanh-taskbar_1280x720-800-resize.jpg\" data-file-size=\"0\" data-rotate=\"\" data-percentage=\"100,\" name=\"cach-hien-thi-icon-tren-thanh-taskbar_1280x720-800-resize.jpg\" style=\"width: 100%;\" data-index=\"0\"></figure></div></div><h2>System Tray l ni tng hp li nhng icon tnh nng v ng dng trn<span>&nbsp;</span><a href=\"https://www.thegioididong.com/laptop\" target=\"_blank\" type=\"my tnh\">my tnh</a><span>&nbsp;</span>li khu vc bn di mn hnh. Tnh nng ny gip Desktop gn gng hn rt nhiu v s rt tin nu bn thng thao tc vi nhng ng dng ny. Sau y, mnh s hng dn<span>&nbsp;</span><a href=\"https://www.thegioididong.com/tin-tuc/cach-hien-thi-icon-tren-thanh-taskbar-1411870\" target=\"_blank\" type=\"cch hin ng dng trong System Tray ra Taskbar\">cch hin th icon trn thanh Taskbar</a><span>&nbsp;</span>rt n gin nh.</h2><h3><strong>Cch hin th icon trn thanh Taskbar</strong></h3><p><strong>Bc 1:<span>&nbsp;</span></strong>Bn phi chut vo<span>&nbsp;</span><strong>thanh Taskbar chn Taskbar Setting</strong>.</p><div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"cch hin ng dng trong System Tray ra Taskbar \" class=\" lazyloaded\" src=\"https://cdn.tgdd.vn/Files/2022/01/20/1411870/cachhienungdungtrongsystemtrayrataskbar6-_1366x768-800-resize.jpg\" data-origin=\"100,100\" data-proportion=\"true\" data-size=\"100%,\" data-align=\"\" data-file-name=\"cachhienungdungtrongsystemtrayrataskbar6-_1366x768-800-resize.jpg\" data-file-size=\"0\" data-rotate=\"\" data-percentage=\"100,\" name=\"cachhienungdungtrongsystemtrayrataskbar6-_1366x768-800-resize.jpg\" style=\"width: 100%;\" data-index=\"1\"></figure></div></div><p><strong><br></strong></p><p><strong>Bc 2:</strong>&nbsp;Bn tm  mc<span>&nbsp;</span><strong>Select which icons appear on the taskbar</strong>. Chn vo mc ny nh.</p><div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"cch hin ng dng trong System Tray ra Taskbar \" class=\" lazyloaded\" src=\"https://cdn.tgdd.vn/Files/2022/01/20/1411870/cachhienungdungtrongsystemtrayrataskbar5-_1366x768-800-resize.jpg\" data-origin=\"100,100\" data-proportion=\"true\" data-size=\"100%,\" data-align=\"\" data-file-name=\"cachhienungdungtrongsystemtrayrataskbar5-_1366x768-800-resize.jpg\" data-file-size=\"0\" data-rotate=\"\" data-percentage=\"100,\" name=\"cachhienungdungtrongsystemtrayrataskbar5-_1366x768-800-resize.jpg\" style=\"width: 100%;\" data-index=\"2\"></figure></div></div><p><strong><br></strong></p><p><strong>Bc 3:</strong><span>&nbsp;</span>Ti mc<span>&nbsp;</span><strong>Always show all icons in the notification area bn gt thnh nt ON<span>&nbsp;</span></strong> a tt c ra ngoi nh.</p><div class=\"imgwrap\"><div class=\"se-component se-image-container __se__float- __se__float-none\" contenteditable=\"false\" style=\"width: 100%;\"><figure style=\"margin: 0px; width: 100%;\"><img alt=\"cch hin ng dng trong System Tray ra Taskbar \" class=\" lazyloaded\" src=\"https://cdn.tgdd.vn/Files/2022/01/20/1411870/cachhienungdungtrongsystemtrayrataskbar3-_1366x768-800-resize.jpg\" data-origin